import React from 'react';

export default function WeatherCard({info}) {
    const {date, weather} = info;
    let dateUtc = new Date(+date); 
    console.log(dateUtc);
    let weatherCels = (weather - 32) * 5/9;
    return (
        <>
        <div className="weather__card">
            {/* <div className="weather__date">{`${dateUtc.getFullYear()}-0${dateUtc.getMonth()+1}-${dateUtc.getDate()}`}</div> */}
            <div className="weather__icon">{dateUtc}</div>
            <div className="weather__icon">{new Date(dateUtc/1000)}</div>
            <div className="weather__temp">{weatherCels}</div>
        </div>
        </>
    )
}
